import React from 'react';

const Home = () => {
  return (
    <div className="min-h-screen bg-gray-100 flex justify-center items-center">
      <div className="text-center">
        <h1 className="text-4xl font-bold text-blue-500">Welcome to the Online Bookstore</h1>
        <p className="mt-4 text-gray-700">Browse through a collection of amazing books!</p>
      </div>
    </div>
  );
};

export default Home;
